    "2016-07-27T22:44:44.807532",nt"name": "update-to-hazard-assessment-of-selenium-contamination-at-benton-lake-national-wildlife-ref",nt"isopen":
    false,nt"url": null,nt"notes": "The levels of selenium in all trophic levels
    in Unit 1 on the refuge continue to be a concern. The mean concentration of selenium
    in water, sediment, macroinvertebrates and aquatic bird eggs were all above the
    u201cminimalu201d hazard level identified as the desired objective for the refuge.
    The overall hazard ranking for the unit is u201chighu201d, which denotes a toxic
    threat sufficient to cause complete reproductive failure in sensitive species of
    aquatic birds (e.g. waterfowl). The selenium data from 2011 indicate that selenium
    hazard is at least similar to 2008, and is likely increasing. There is no evidence
    that selenium levels are on a downward trend. This is consistent with what would
    be expected based on the recent increases in natural run-off, which increase selenium
    inputs, and modeling of selenium cycling on the refuge (Zhang and Moore 1997).",nt"license_title":
